    value: "<h3 class=\"rtecenter text-align-center\" style=\"color:#0C5C97\">Agenda</h3>\r\n\r\n<p><strong>September 26, 2018</strong></p>\r\n\r\n<p>6:00 p.m. Mandatory Meeting Kick-off</p>\r\n\r\n<p><strong>September 27, 2018</strong></p>\r\n\r\n<p>8:30 a.m. - 3:00 p.m.</p>\r\n\r\n<p class=\"rteindent1\">Discuss current treatments, outcomes and concepts for future research for adult Histone Mutated Midline Glioma as part of the NCI-CONNECT scientific research program.</p>\r\n\r\n<p>A more detailed agenda will be provided in the future.</p>\r\n\r\n<p class=\"rtecenter text-align-center\"><a href=\"/nob/nciconnect/registration\" title=\"REGISTER LINK\">REGISTER LINK</a></p>\r\n"
